(1, 'Pooja Kandari & Narinder Singh Negi', 'Success Stories', NULL, NULL, '<p><strong>Pooja Kandari & Narinder Singh Negis story is a perfect example of how true connections are made through a trusted matrimonial platform.</strong></p><p><br></p><p>They connected through our platform and discovered that they shared <strong>similar values</strong>, <strong>mutual respect</strong>, and a <strong>genuine emotional bond</strong>. From their <strong>first conversation</strong> to their <strong>official meeting</strong>, every step was filled with <strong>trust</strong>, <strong>understanding</strong>, and <strong>compatibility</strong>.</p><p><br></p><p>Their families played an important role in supporting this beautiful journey, making the entire experience <strong>smooth</strong>, <strong>joyful</strong>, and memorable. <strong>Pooja and Narinders match reflects how meaningful relationships flourish when two individuals share clarity, respect, and shared dreams.</strong></p><p><br></p><p>Through <strong>open communication</strong> and <strong>mutual understanding</strong>, they built a strong foundation for a <strong>happy and lasting relationship</strong>. Their story inspires others to believe that with the <strong>right platform</strong>, finding <strong>the right partner</strong> is both possible and rewarding.</p><p><br></p><p><strong>We congratulate Pooja Kandari & Narinder Singh Negi</strong> on their wonderful journey and wish them a <strong>lifetime of love, happiness, and togetherness</strong>.</p>', '2023-01-13 10:15:08', '2025-10-07 16:07:57', 'Read the matrimonial story of Pooja Kandari & Narinder Singh Negi  a beautiful journey of finding t', 'uploads/cms/banner/da91c553d7729ee6bddefb4400240f4c.jpg', '', 'pooja-kandari-narinder-singh-negi', '', NULL, NULL, 0, NULL, 'pooja kandari, narinder singh negi, matrimonial match, wedding profile, success story', 'Pooja Kandari & Narinder Singh Negi', 'Select Ratings'),
(2, 'About MyShaadi', 'About Us', NULL, NULL, '<p><strong>Welcome to MyShaadi  a trusted and reliable matrimonial platform dedicated to helping individuals find their perfect life partner.</strong></p><p>At <strong>MyShaadi</strong>, we focus on providing a <strong>secure, transparent, and user-friendly experience</strong> for all members. Our platform brings together <strong>verified profiles</strong>, <strong>advanced matchmaking tools</strong>, and <strong>personalized services</strong> to make the search for a life partner <strong>efficient, meaningful, and enjoyable</strong>.</p><p><br></p><p>We are committed to <strong>privacy, authenticity, and trust</strong>, ensuring that every member can connect with <strong>genuine, like-minded individuals</strong>. Our team works tirelessly to <strong>verify profiles, maintain security</strong>, and provide <strong>customer support</strong>, making the platform <strong>safe and reliable</strong> for all users.</p><p><br></p><p>Through <strong>smart algorithms</strong>, <strong>personalized suggestions</strong>, and <strong>detailed search filters</strong>, members can explore profiles based on <strong>age, education, profession, community, location, and preferences</strong>, allowing them to find <strong>compatible matches</strong> easily.</p><p><br></p><p>At <strong>MyShaadi</strong>, our mission is to <strong>create lasting relationships</strong> and facilitate <strong>happy marriages</strong> by combining <strong>technology, trust, and personal attention</strong>. We celebrate the success stories of our members and strive to <strong>help more individuals find meaningful connections</strong>.</p><p><br></p><p><strong>Join MyShaadi today</strong> and experience a platform that is dedicated to helping you <strong>find your perfect life partner in a safe, secure, and professional environment</strong>.</p>', '2023-01-20 15:36:28', '2025-10-07 16:06:50', 'Learn more about MyShaadi  a trusted matrimonial platform dedicated to helping people find their pe', 'uploads/cms/banner/4a2fa1f0c9dc21aed9a720844f40b71a.jpg', '', 'about-myshaadi', '', NULL, NULL, 1, NULL, 'about myshaadi, matrimonial website, trusted platform, marriage services, matchmaking', 'My Shaadi', 'Select Ratings'),
(3, 'Anjali Dobhal & Abhishek Uniyal', 'Success Stories', NULL, NULL, '<p><strong>Anjali Dobhal & Abhishek Uniyals journey is a perfect example of how meaningful connections can be made through a trusted matrimonial platform.</strong></p><p><br></p><p>They connected on our platform and quickly discovered that they shared <strong>similar values</strong>, <strong>mutual respect</strong>, and a <strong>strong emotional bond</strong>. From their <strong>first conversation</strong> to their <strong>official meeting</strong>, every step of their journey was filled with <strong>trust</strong>, <strong>understanding</strong>, and <strong>compatibility</strong>.</p><p><br></p><p>Their families played an important role in supporting this beautiful union, making the entire process <strong>smooth</strong>, <strong>joyful</strong>, and truly memorable. <strong>Anjali and Abhisheks match reflects how genuine relationships blossom when two individuals share clarity, respect, and shared dreams.</strong></p><p><br></p><p>Through <strong>open communication</strong> and <strong>mutual understanding</strong>, they built a strong foundation for a <strong>happy and lasting relationship</strong>. Their story inspires others to believe that with the <strong>right platform</strong>, finding <strong>the right partner</strong> is both possible and rewarding.</p><p><br></p><p><strong>We congratulate Anjali Dobhal & Abhishek Uniyal</strong> on their wonderful journey and wish them a <strong>lifetime of love, happiness, and togetherness</strong>.</p>', '2023-01-23 11:44:10', '2025-10-07 16:05:48', 'Read the matrimonial story of Anjali Dobhal & Abhishek Uniyal. A beautiful success story of finding', 'uploads/cms/banner/1a10ca8ec2dea0e715db1a46ed9b79c8.jpg', '', 'anjali-dobhal-abhishek-uniyal', '', NULL, NULL, 0, NULL, 'anjali dobhal, abhishek uniyal, matrimonial match, wedding profile, success story', 'Anjali Dobhal & Abhishek Uniyal', 'Select Ratings'),
(4, 'Terms and Conditions', 'Terms And Conditions', NULL, NULL, '<p><strong>Welcome to MyShaadi!</strong> By using our platform, <strong>you agree to comply with and be bound by these Terms & Conditions</strong>. These rules are designed to ensure a <strong>safe, secure, and transparent experience</strong> for all users.</p><p><br></p><p>All members are expected to provide <strong>accurate and truthful information</strong> in their profiles. <strong>Misrepresentation, false details, or fraudulent activity</strong> is strictly prohibited. <strong>Profiles, photos, and personal details</strong> should reflect genuine information to maintain <strong>trust and credibility</strong> on the platform.</p><p><br></p><p>Our platform provides <strong>matching and communication services</strong>. By using these services, you agree to <strong>use them responsibly</strong>, <strong>respect other users</strong>, and <strong>avoid any abusive, offensive, or illegal behavior</strong>. <strong>Harassment, spam, or misuse of the platform</strong> will result in account suspension or termination.</p><p><br></p><p>All <strong>subscriptions, payments, refunds, and cancellations</strong> are governed by our <strong>Refund & Cancellation Policy</strong>, and you agree to follow the terms mentioned there.</p><p><strong>MyShaadi is committed to protecting your privacy and personal data</strong>. By using our platform, you acknowledge our <strong>Privacy Policy</strong> and agree that your data may be used to provide <strong>personalized matchmaking services</strong>.</p><p><br></p><p>We reserve the right to <strong>modify, update, or terminate any service</strong> or feature without prior notice, and you agree to comply with these changes.</p><p>By continuing to use MyShaadi, <strong>you confirm your acceptance of these Terms & Conditions</strong>, and you agree to use the platform in a <strong>responsible, ethical, and lawful manner</strong>.</p><p><strong>For any questions or concerns regarding these Terms & Conditions, please contact our support team</strong>.</p>', '2023-01-23 16:11:13', '2025-10-07 16:04:46', 'Read the Terms & Conditions of MyShaadi to understand the rules, user agreement, and policies for us', '', '', 'terms-and-conditions', '', NULL, NULL, 0, NULL, 'terms and conditions, matrimonial website, user agreement, platform rules, policies', 'Terms and Conditions', 'Select Ratings'),
(5, 'Privacy Policy', 'Privacy Policy', NULL, NULL, '<p><strong>At MyShaadi, we take your privacy very seriously.</strong> Our <strong>Privacy Policy</strong> is designed to explain how we <strong>collect, use, store, and protect your personal information</strong> while providing you with a <strong>trusted matrimonial experience</strong>.</p><p><br></p><p>When you create an account, we collect <strong>personal details</strong> such as <strong>name, contact information, date of birth, education, profession, and partner preferences</strong>. This information helps us to provide <strong>personalized matchmaking suggestions</strong> and ensure that your search for a life partner is <strong>efficient, meaningful, and secure</strong>.</p><p>All your data is <strong>stored securely</strong> with advanced encryption and is never shared with third parties without your <strong>explicit consent</strong>, except when required by law. We follow <strong>strict privacy protocols</strong> to ensure that your <strong>profile information, photos, and communications</strong> remain <strong>confidential</strong> at all times.</p><p>Our platform uses <strong>cookies and analytics tools</strong> to enhance your browsing experience, provide <strong>relevant matches</strong>, and improve our <strong>services</strong>. You have complete control over your information and can <strong>update, modify, or delete your profile data</strong> anytime through your account settings.</p><p>We also take extra care with <strong>sensitive information</strong> such as <strong>profile photos, family details, and private messages</strong>. These are visible only to users you approve and are protected by our <strong>security and privacy measures</strong>.</p><p>By using MyShaadi, <strong>you agree to our Privacy Policy</strong> and our commitment to handling your data responsibly. For any questions or concerns regarding <strong>your privacy</strong>, you can <strong>contact our dedicated support team</strong>, who will assist you promptly.</p><p><br></p><p><strong>Your trust and privacy are our top priorities, and we strive to make your journey to find a life partner both safe and fulfilling.</strong></p>', '2023-01-23 16:11:53', '2025-10-07 16:01:57', 'Read our privacy policy to know how we collect, use, and protect your personal information on our ma', '', '', 'privacy-policy', '', NULL, NULL, 0, NULL, 'privacy policy, user data protection, matrimonial privacy, personal information', 'Privacy Policy', 'Select Ratings'),
(6, 'Refund And cancellation', 'Terms And Conditions', NULL, NULL, NULL, '2023-01-23 17:25:48', '2023-01-23 17:26:01', 'Refund And cancellation', '', '', 'refund-and-cancellation', '', NULL, NULL, 0, '2023-01-23 17:26:01', 'Refund And cancellation', 'Refund And cancellation', 'Select Ratings'),
(7, 'Refund and cancellation', 'Refund And Cancellation', NULL, NULL, '<p>Refund and cancellation</p>', '2023-01-23 17:35:22', '2023-03-24 09:44:02', 'Refund and cancellation', '', '', 'refund-and-cancellation', '', NULL, NULL, 0, '2023-03-24 09:44:02', 'Refund and cancellation', 'Refund and cancellation', 'Select Ratings'),
(8, 'Refund And cancellation', 'Refund And Cancellation', NULL, NULL, '<p><strong>We believe in maintaining transparency and trust with all our members.</strong> Our <strong>Refund & Cancellation Policy</strong> is designed to provide clear information about how <strong>refunds</strong> and <strong>cancellations</strong> are handled on our platform.</p><p><br></p><p>All users are requested to <strong>review the policy carefully</strong> before making any payments or subscribing to our services. In case you wish to cancel your membership or any paid service, <strong>you must initiate the cancellation within the specified period</strong> mentioned in the plan details.</p><p><br></p><p><strong>Refunds are processed as per the terms and conditions</strong> agreed upon at the time of purchase. Certain services may be <strong>non-refundable</strong>, especially if they involve <strong>personalized matchmaking</strong> or <strong>premium features</strong> that have already been utilized.</p><p><br></p><p>We ensure that every <strong>refund and cancellation request is handled fairly and promptly</strong>, keeping in mind both user satisfaction and platform guidelines.</p><p>If you have any questions or need support regarding <strong>refunds or cancellations</strong>, you can <strong>contact our customer support team</strong>, and they will assist you throughout the process.</p><p><br></p><p><strong>By subscribing to our services, you agree to the terms of this Refund & Cancellation Policy.</strong></p>', '2023-01-23 17:46:56', '2025-10-07 15:59:33', 'Refund And cancellation', '', '', 'refund-and-cancellation', '', NULL, NULL, 0, NULL, 'refund policy, cancellation policy, matrimonial refund, subscription cancellation', 'Refund & Cancellation Policy', 'Select Ratings'),
(9, 'Nikita Bisht & Jeevan Singh Rawat', 'Success Stories', NULL, NULL, '<p><strong>Nikita Bisht & Jeevan Singh Rawats story is a beautiful example of how true connections are made through a trusted matrimonial platform.</strong></p><p>They connected through our platform and quickly discovered that they shared <strong>similar values</strong>, <strong>mutual respect</strong>, and a <strong>strong emotional understanding</strong>. From their <strong>first conversation</strong> to their <strong>official meeting</strong>, every step of their journey was filled with <strong>trust</strong>, <strong>genuine bonding</strong>, and <strong>compatibility</strong>.</p><p><br></p><p>Their families played an important role in supporting this beautiful union, making the entire process <strong>smooth</strong>, <strong>joyful</strong>, and truly memorable. <strong>Nikita and Jeevans match is a reflection of how meaningful relationships can blossom when two individuals share clarity, respect, and shared dreams.</strong></p><p><br></p><p>Through <strong>open communication</strong> and <strong>mutual understanding</strong>, they built a strong foundation for a <strong>happy and lasting relationship</strong>. Their story is a reminder that with the <strong>right platform</strong>, finding <strong>the right partner</strong> becomes a beautiful and fulfilling experience.</p><p><br></p><p><strong>We congratulate Nikita Bisht & Jeevan Singh Rawat</strong> on their wonderful journey and wish them a <strong>lifetime of love, happiness, and togetherness</strong>.</p><p><br></p>', '2023-03-24 09:34:54', '2025-10-07 15:57:31', 'Read the matrimonial story of Nikita Bisht & Jeevan Singh Rawat. A perfect match found through our t', 'uploads/cms/banner/f85803f3e9047add73cb6ee62f570d68.png', '', 'nikita-bisht-jeevan-singh-rawat', '', NULL, NULL, 1, NULL, 'nikita bisht, jeevan singh rawat, matrimonial match, wedding profile', 'Nikita Bisht & Jeevan Singh Rawat', 'Select Ratings'),
(10, 'Best Matches', 'Our Promise', NULL, NULL, '<p><strong>Finding the right life partner is a journey that deserves attention, trust, and meaningful connections.</strong> Our <strong>Best Matches</strong> section is specially designed to help you discover <strong>profiles that truly align with your lifestyle, values, and preferences</strong>.</p><p><br></p><p>With the help of our <strong>smart matchmaking technology</strong>, we bring you <strong>highly compatible and personalized suggestions</strong>. These matches are based on multiple factors such as <strong>age</strong>, <strong>location</strong>, <strong>education</strong>, <strong>profession</strong>, <strong>community</strong>, <strong>interests</strong>, and other important preferences you set in your profile.</p><p><br></p><p>Every profile shown under <strong>Best Matches</strong> goes through a <strong>thorough verification process</strong> to ensure <strong>authenticity</strong> and <strong>genuineness</strong>. We aim to provide you with <strong>trusted and secure matches</strong> so that your search remains focused and worry-free.</p><p><br></p><p>Through the <strong>Best Matches</strong> feature, you can <strong>save valuable time</strong> by viewing only <strong>relevant and well-matched profiles</strong>, rather than browsing through endless options. This makes your partner search journey <strong>faster</strong>, <strong>smarter</strong>, and more <strong>personalized</strong>.</p><p><br></p><p>Our platform encourages you to take the next step with <strong>confidence</strong>, knowing that each profile is carefully curated to increase your chances of finding <strong>real, compatible, and long-lasting connections</strong>.</p><p><strong>Start exploring your Best Matches today</strong> and take a meaningful step towards finding <strong>your perfect life partner</strong> through a <strong>safe</strong>, <strong>trusted</strong>, and <strong>user-friendly matrimonial experience</strong>.</p><p><br></p>', '2024-07-20 16:30:20', '2025-10-07 15:56:10', 'Discover best matches for your life partner. Browse verified matrimonial profiles and find your perf', 'uploads/cms/banner/5107c04f35eef08422ef9b31ae4f75a7.jpg', '', 'best-matches', '', NULL, NULL, 0, NULL, 'best matches, marriage partner, matrimonial profiles', 'Best Matches for Marriage', 'Select Ratings');
